import { Routes, Route, Navigate } from "react-router-dom";
import React from "react";

import Home from "src/pages/Home/Home.js"
import Character from "src/pages/Character/Character.js"
import Characters from "src/pages/Characters/Characters.js"
import Houses from "src/pages/Houses/Houses.js"

function AppRoute() {
    return(
        <Routes>
        <Route
          path="/"
          element={<Home />}
        />

        <Route
          path="/character"
          element={<Character />}
        />
        <Route
          path="/characters"
          element={<Characters />}
        />
        <Route
          path="/spacecraft/:id"
          element={<Spacecraft />}
        />

        <Route
          path="/houses"
          element={<Hou />}
        />

        <Route
          path="*"
          element={<Navigate to={"/"} />}
        />
      </Routes>
    )
}

export default AppRoute;
